import React, { useContext, useState } from 'react';
import { AuthContext } from '../../context/authContext';
import Logo from '../logo';

const GestionRutas = () => {
  const { setAuth } = useContext(AuthContext);
  const [rutas, setRutas] = useState([
    { id: 'R105', detalles: 'Detalles de la ruta R105' },
    { id: 'R106', detalles: 'Detalles de la ruta R106' },
    { id: 'R107', detalles: 'Detalles de la ruta R107' },
  ]);

  const handleLogout = () => {
    setAuth(null);
  };

  const styles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
    },
    title: {
      backgroundColor: '#ffd700',
      color: 'black',
      padding: '10px',
      textAlign: 'center',
    },
    section: {
      marginBottom: '20px',
      padding: '15px',
      borderRadius: '5px',
    },
    input: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
    },
    button: {
      backgroundColor: '#4a5d23',
      color: 'white',
      border: 'none',
      padding: '10px 15px',
      cursor: 'pointer',
      marginRight: '10px',
    },
    textarea: {
      width: '100%',
      padding: '5px',
      marginBottom: '10px',
      minHeight: '100px',
    },
  };

  return (
    <div>
      < Logo/>
    <div style={styles.container}>
      <h1 style={styles.title}>GESTIÓN DE RUTAS</h1>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>VER RUTA</h2>
        {rutas.map((ruta) => (
          <div key={ruta.id}>
            <span>{ruta.id}</span>
            <button style={styles.button}>Ver + Detalles</button>
          </div>
        ))}
        <textarea style={styles.textarea} placeholder="DETALLE DE RUTA" readOnly></textarea>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>BUSCAR RUTA</h2>
        <input style={styles.input} type="text" placeholder="ID DE RUTA" />
        <button style={styles.button}>Buscar</button>
        <textarea style={styles.textarea} placeholder="INFORMACIÓN DE LA RUTA" readOnly></textarea>
      </div>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        <h2>CREAR RUTA</h2>
        <input style={styles.input} type="text" placeholder="ID DE RUTA" />
        <input style={styles.input} type="text" placeholder="ID ASIGNACIÓN" />
        <input style={styles.input} type="time" placeholder="HORA INICIO" />
        <input style={styles.input} type="time" placeholder="HORA LLEGADA" />
        <button style={styles.button}>Agregar ruta</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#f0f0f0'}}>
        <h2>MODIFICAR RUTA</h2>
        <input style={styles.input} type="text" placeholder="ID DE RUTA" />
        <input style={styles.input} type="time" placeholder="HORA INICIO" />
        <input style={styles.input} type="time" placeholder="HORA LLEGADA" />
        <button style={styles.button}>Actualizar Ruta</button>
      </div>

      <div style={{...styles.section, backgroundColor: '#e6f3e6'}}>
        
        <h2>ELIMINAR RUTA</h2>
        <input style={styles.input} type="text" placeholder="ID DE RUTA" />
        <textarea style={styles.textarea} placeholder="INFORMACIÓN DE LA RUTA" readOnly></textarea>
        <button style={styles.button}>Buscar</button>
        <button style={styles.button}>Eliminar ruta</button>
      </div>

      <button style={{...styles.button, display: 'block', margin: '20px auto'}} onClick={handleLogout}>
        VOLVER AL PANEL
      </button>
    </div>
    </div>
  );
};

export default GestionRutas;
